import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AddSubject from './components/AddSubject';
import FacultySubjectMapping from './components/FacultySubjectMapping';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100">
        <nav className="bg-white shadow-lg mb-4">
          <div className="max-w-7xl mx-auto px-4 py-3">
            <Link to="/" className="text-gray-800 hover:text-gray-600 mr-4">Home</Link>
            <Link to="/subjects/add" className="text-gray-800 hover:text-gray-600 mr-4">Add Subject</Link>
            <Link to="/mapping/faculty" className="text-gray-800 hover:text-gray-600">Assign Faculty</Link>
          </div>
        </nav>
        <Routes>
          <Route path="/" element={
            <div className="max-w-7xl mx-auto px-4 py-8">
              <h1 className="text-3xl font-bold">Welcome to SmartCMS</h1>
            </div>
          } />
          <Route path="/subjects/add" element={<AddSubject />} />
          <Route path="/mapping/faculty" element={<FacultySubjectMapping />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
